INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2030/12/17 14:59:59", 10040, "リン", "2020/04/30 12:00:00", 24001, 0.0, 0.0, "あたしだって\nやるときはやるよ！", 0, 24, 102601, 0.0, 1, 1);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2030/12/17 14:59:59", 10040, "リン", "2020/04/30 12:00:00", 24002, 0.0, 0.0, "ふぅ…\nこれであたしの仕事は\n終わりだね", 1, 24, 102601, 0.0, 1, 1);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2030/12/17 14:59:59", 10040, "リン", "2020/04/30 12:00:00", 24003, 0.0, 0.0, "終わった終わった\n一人でもなんとか\nなるもんだね", 2, 24, 102601, 0.0, 1, 1);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2030/12/17 14:59:59", 10040, "リン", "2020/04/30 12:00:00", 24004, 0.0, 0.0, "やったね！\nこれでようやく\nサボれるよ…", 3, 24, 102601, 0.0, 2, 2);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2030/12/17 14:59:59", 10040, "リン", "2020/04/30 12:00:00", 24005, 0.0, 0.0, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 4, 24, 102601, 0.0, 1, 1);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2030/12/17 14:59:59", 10040, "リン", "2020/04/30 12:00:00", 24006, 0.0, 0.0, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 5, 24, 102601, 0.0, 2, 2);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2030/12/17 14:59:59", 10040, "リン", "2020/04/30 12:00:00", 24007, 0.0, 0.0, "あたしも意外と\nやるもんでしょ？", 6, 24, 102601, 0.0, 2, 2);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2030/12/17 14:59:59", 10040, "リン", "2020/04/30 12:00:00", 24008, 0.0, 0.0, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 7, 24, 102601, 0.0, 4, 4);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2030/12/17 14:59:59", 10040, "リン", "2020/04/30 12:00:00", 24009, 0.0, 0.0, "このままじゃ\nまっひ～に\n叱られちゃうよ", 8, 24, 102601, 0.0, 4, 4);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2030/12/17 14:59:59", 10040, "リン", "2020/04/30 12:00:00", 24010, 0.0, 0.0, "まじめに\nやったんだけどな…\n悔しいな～", 9, 24, 102601, 0.0, 4, 4);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2030/12/17 14:59:59", 10040, "リン", "2020/04/30 12:00:00", 24011, 0.0, 0.0, "やられた…\nねずみって意外と\nてごわいね", 10, 24, 102601, 0.0, 4, 4);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2030/12/17 14:59:59", 10040, "リン", "2020/04/30 12:00:00", 24012, 0.0, 0.0, "おのれ～\nあたしのチーズを\n盗みやがって～！", 11, 24, 102601, 0.0, 4, 4);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2030/12/17 14:59:59", 10040, "リン", "2020/04/30 12:00:00", 24013, 1.81, 0.0, "疲れた…\nけど、次こそは\n守り抜くよ…", 12, 24, 102601, 0.0, 1, 4);
